import React from 'react';

interface IAddTaskFormProps extends React.PropsWithChildren {
  text: string;
  onWriteTask: React.ChangeEventHandler<HTMLInputElement>;
}

const AddTaskForm: React.FC<IAddTaskFormProps> = props => {
  return (
    <div className="container">
      <div className="form-block">
        <div>
          <form>
            <input type="text" onChange={props.onWriteTask} className="text-field" value={props.text}/>
          </form>
        </div>
        <div>
          <button type="button" className="add-button">Add</button>
        </div>
      </div>
    </div>
  );
};

export default AddTaskForm;
